import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
display: flex;
padding: 0 20px;
`;

const Left = styled.div`
    width: 60%;
`;

const Right = styled.div`
    width: 40%;
`;

const Image = styled.img`
    height: 100vh;
    border-top-left-radius: 300px;
    border-top-right-radius: 300px;
`;

const Title = styled.p`
    font-size: 54px;  
    margin-top: 40px;
    text-align: center;
`;

const Text = styled.p`
    font-size: 20px;
    padding: 10px 0;
`;

const Price = () => {
  return (
      <>
    <Title>Price list</Title>
    <Container>
        <Left>
        <Text>It all depends on weight and design. Price for 1 kilo is <b>200 hrn</b>. Also it depends on type of cream, type of fruits used in cake and so on. Final price we always tell in the end of discussion.</Text>
        </Left>
        <Right>
            <Image/>
        </Right>
    </Container>
    </>
  )
}

export default Price
